import ProducctsService from "../../../services/ProducctsService";
import { productsLoadingAction, productsSuccessAction, productsFailAction } from "../actions";

export const getProductsThunk = ( dispatch, params) => {
    dispatch(productsLoadingAction());

    ProducctsService.getProducts(params)    
      .then((response) => {
        dispatch(productsSuccessAction(response))
       
      })
      .catch(({response}) => {
        dispatch(productsFailAction(response?.data?.message))
      });
};
